import React from "react";
import PropTypes from 'prop-types'; 

export default function ButtonStyle1({ buttonText,buttonIcon='', onClick , buttonClassName,}){
    return(
      <button onClick={onClick} className={`bg-[#1E3A8A] hover:bg-[#3B82F6] text-white rounded-[5px] p-1 text-[16px] font-Cairo ${buttonClassName}`}>
      <div className="flex">
      <img src={buttonIcon} className="w-3 h-3"/>
      {buttonText}
      </div>
    </button>
    );
}

ButtonStyle1.propTypes = {
    buttonText: PropTypes.string.isRequired,
    onClick: PropTypes.func.isRequired,
    className: PropTypes.string,
  };
